document.getElementById("zoomout").onclick = function (evt) {
	dx.options.scales.yAxes[0].ticks.min-=200;
	dx.update();
};
document.getElementById("zoomin").onclick = function (evt) {
	if(dx.options.scales.yAxes[0].ticks.min < -50){
		dx.options.scales.yAxes[0].ticks.min+=50;
	}
	dx.update();
};
